import React from 'react';

const Task = (props) =>{
    const {text, date, id} = props.task

    return (
       <div>
           <p>
               <strong>{text}</strong> - <span>{date} </span>
               <button onClick={() => props.change(id)}>Completed</button>
               <button onClick={props.delete} >X</button> 
           </p>


       </div>
    )
}

export default Task
